import MyButton from "../../UI/MyButton/MyButton"


const ScheduleForm = () =>
{
    const TravelTo = () =>
    {
        window.location.href = "http://localhost:3000/schedule"
    }
    return (
        <div>
            <MyButton onClick = {TravelTo}>Расписание</MyButton>
        </div>
    )
}

export default ScheduleForm;
